import React from "react";
import ArticleCard from "./ArticleCard";

function ArticlesList(props) {
  const { articles } = props;
  return (
    <ul>
      Our latest articles...
      {articles.map(article => (
        <ArticleCard article={article}/>
      ))}
    </ul>
  );
}

export default ArticlesList;
